import React from "react";

function footer() {
    const namaMhs = "Wawan Gunadi";
    return(
        <div>
           <h3>Halaman footer</h3>
           <footer>©2025 Design With❤ by {namaMhs}</footer> 
        </div>
    );
}
export default footer;
